create table Lieu (
	id_lieu INT,
	nom_lieu VARCHAR(50),
	numero_voie VARCHAR(50),
	nom_voie VARCHAR(50),
	complement_adresse VARCHAR(50),
	adresse_complete VARCHAR(50),
	codePostal VARCHAR(50),
	departement VARCHAR(50),
	region VARCHAR(50),
	ville VARCHAR(50),
	pays VARCHAR(50),
	continent VARCHAR(50),
	nbPersonnel INT
);
